import React, { Component } from 'react'

import "./content.css"
import Nav from './Nav'
import QjLevel from './qjLevel/QjLevel'

class Content extends Component {
    render() {
        return (
            <div className="container">
                <Nav />
                <QjLevel />
            </div>
        )
    }
}

export default Content;
